package org.giddap.dreamfactory.leetcode.onlinejudge;

import org.giddap.dreamfactory.leetcode.onlinejudge.implementations.MinimumWindowSubstringLinearImpl;
import org.giddap.dreamfactory.leetcode.onlinejudge.implementations.MinimumWindowSubstringOnImpl;
import org.junit.Test;

import static org.junit.Assert.assertEquals;

public class MinimumWindowSubstringTest {
    private MinimumWindowSubstring solution2 = new
            MinimumWindowSubstringOnImpl();

    private MinimumWindowSubstring solution = new
            MinimumWindowSubstringLinearImpl();

    @Test
    public void small01() {
        assertEquals("BANC", solution.minWindow("ADOBECODEBANC", "ABC"));
    }

    @Test
    public void small02() {
        assertEquals("a", solution.minWindow("a", "a"));
    }

    @Test
    public void small03() {
        assertEquals("", solution.minWindow("a", "aa"));
    }

    @Test
    public void small04() {
        assertEquals("aa", solution.minWindow("aa", "aa"));
    }

    @Test
    public void large01() {
        assertEquals("zcsuvvlueppauqcwekdypxnqut", solution.minWindow("", "clqzatusku"));
    }

    @Test
    public void large02() {
        assertEquals("ogeuxsvfsipmzjwthxllfjtcsutrtfbhmidlcyruiiihrgdzdq", solution.minWindow("", "zxgohysqphhm"));
    }

    @Test
    public void large03() {
        assertEquals("",
                solution.minWindow("",
                        ""));
    }
}
